import React from 'react'
import { Card, CardContent, CardHeader, Typography } from '@mui/material'

function IndexStatus({data}) {
  return (
    <Card variant="outlined"
    style={{
        padding: 10,
        margin: 10,
        display: 'flex',
        flexDirection: 'column',
    }}>
        <CardHeader>
        <CardContent style={{
            flex: 1
        }}>
            <Typography variant='h4'>{data['Symbol']}</Typography>
            <Typography>{data['Current Price']}</Typography>
            <Typography>{data['Last Updated Time']}</Typography>
        </CardContent>
        </CardHeader>
        
    </Card>
  )
}

export default IndexStatus
